import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { useParams } from 'react-router-dom'
import { fetchMedicalHistory } from '../actions/userAction'

const Medicalhistory = () => {
  const { id } = useParams()
  const dispatch = useDispatch()
  const medicalHistoryState = useSelector(state => state.userMedical)
  const { medicalHistories, loading, error } = medicalHistoryState

  useEffect(() => {
    if (id) {
      dispatch(fetchMedicalHistory(id))
    }
  }, [dispatch, id])

  return (
    <div>
      {loading && <p>Loading...</p>}
      {error && <p>Error: {error}</p>}
      <ul>
        {medicalHistories.map(history => (
          <li key={history._id}>
            <p>ID: {history._id}</p>
            <p>User: {history.user.name}</p>
            <p>Staff: {history.staff}</p>
            <p>Test: {history.test}</p>
            {/* <p>Medical Prescription: {history.medicalPrescription}</p>
            <p>Diagnostic Result: {history.diagnosticResult}</p> */}
            <p>Date: {history.date}</p>
          </li>
        ))}
      </ul>
    </div>
  )
}

export default Medicalhistory
